import React from "react";
import PropTypes from "prop-types";

const CustomDot = ({ index, onClick, active }) => {
  const videos = [
    {
      id: "1",
      src: "https://www.youtube.com/embed/TYmyoDZoY-o",
      title: "Vídeo 1",
    },
    {
      id: "2",
      src: "https://www.youtube.com/embed/4Tp4sV7aU6s",
      title: "Vídeo 2",
    },
    {
      id: "3",
      src: "https://www.youtube.com/embed/gTfJ3TjSfhI",
      title: "Vídeo 3",
    },
  ];

  const renderIframe = () => {
    const video = videos[index];
    return (
      <iframe
        title={video.title}
        src={video.src}
        frameBorder="0"
        width="400"
        height="200"
        allowFullScreen
      ></iframe>
    );
  };

  return (
    <button
      type="button"
      className={`${
        active ? "bg-red-500" : "bg-gray-500"
      } h-2 w-2 mx-2 rounded-full`}
      onClick={onClick}
      onKeyDown={onClick}
      aria-hidden="true"
    >
      {active && renderIframe()}
    </button>
  );
};

CustomDot.propTypes = {
  index: PropTypes.number.isRequired,
  onClick: PropTypes.func.isRequired,
  active: PropTypes.bool.isRequired,
};

export default CustomDot;
